const Index = () => {
    return (
        <div>
            <a href='/api/login' className='py-4 px-4 rounded bg-pink-800 font-bold shadow-xl houver:shadow block w-1/4 text-center mx-auto text-white'>My Daily Status</a>
        </div>
    )
}
export default Index
